let small=true // Acts as a switch (if true: go big, if false: go small)

setInterval(()=>{ // Starts intervals
    if(small){
    feature.scale.set(.16,.16,.16) // Make it big
    small= !small
  }else{
    feature.scale.set(.1,.1,.1) // Make it small
    small= !small
  }
},1100)
